import {BrowserRouter,Routes,Route} from 'react-router-dom'
const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path='/' element={<AddCourse></AddCourse>}></Route>
      </Routes>
    </BrowserRouter>
  )
}

export default App
